import React from 'react'

function App() {
  const Header = () =>{
    return(
      <header>
        <h1>
          <a href='/'>WEB</a>
        </h1>
      </header>
    )
  }
  const Nav = () => {
    return(
      <nav>
      <ol>
        <li><a href='/reade/1'>html</a></li>
        <li><a href='/reade/2'>css</a></li>
        <li><a href='/reade/3'>js</a></li>
      </ol>
    </nav>
    )
  }
  return (
    <div>
      <Header></Header>
      <Nav></Nav>
      <Article></Article>


    </div>
  )
}

export default App
